import React, { useContext } from 'react';
import { Routes, Route, Link, Navigate, useParams } from 'react-router-dom';
import { AuthContext } from './context/AuthContext';

import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import AdminPage from './pages/AdminPage';
import GrievanceForm from './components/GrievanceForm';

import NonAdminRoute from './components/NonAdminRoute'; // Your non-admin guard
import UserGrievanceDetail from './components/UserGrievanceDetail';

function UserGrievanceDetailWrapper() {
  const { id } = useParams();
  return <UserGrievanceDetail grievanceId={id} />;
}

// Protects routes for authenticated users
function ProtectedRoute({ children }) {
  const { isAuthenticated } = useContext(AuthContext);
  return isAuthenticated ? children : <Navigate to="/login" />;
}

// Protects routes for staff users
function AdminRoute({ children }) {
  const { isAuthenticated, isStaff } = useContext(AuthContext);
  return isAuthenticated && isStaff ? children : <Navigate to="/" />;
}

export default function AppContent() {
  const { isAuthenticated, isStaff, logout } = useContext(AuthContext);

  return (
    <div className="App">
      <nav style={{ marginBottom: '20px', fontSize: '1.2rem' }}>
        {isAuthenticated ? (
          <>
            {!isStaff && (
              <>
                <Link to="/" style={{ marginRight: '15px' }}>
                  Home
                </Link>
                <Link to="/submit-grievance" style={{ marginRight: '15px' }}>
                  Submit Grievance
                </Link>
              </>
            )}
            {isStaff && (
              <Link to="/admin" style={{ marginRight: '15px', color: 'cyan' }}>
                Admin
              </Link>
            )}
            <button onClick={logout}>Logout</button>
          </>
        ) : (
          <>
            <Link to="/login" style={{ marginRight: '15px' }}>
              Login
            </Link>
            <Link to="/register">Register</Link>
          </>
        )}
      </nav>

      <Routes>
        {/* Public routes */}
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />

        {/* Protected user routes */}
        <Route
          path="/submit-grievance"
          element={
            <ProtectedRoute>
              <NonAdminRoute>
                <GrievanceForm />
              </NonAdminRoute>
            </ProtectedRoute>
          }
        />
        <Route
          path="/"
          element={
            <ProtectedRoute>
              <NonAdminRoute>
                <HomePage />
              </NonAdminRoute>
            </ProtectedRoute>
          }
        />

        {/* User grievance detail with reopen, protected */}
        <Route
          path="/user/grievances/:id"
          element={
            <ProtectedRoute>
              <NonAdminRoute>
                <UserGrievanceDetailWrapper />
              </NonAdminRoute>
            </ProtectedRoute>
          }
        />

        {/* Admin only route */}
        <Route
          path="/admin"
          element={
            <AdminRoute>
              <AdminPage />
            </AdminRoute>
          }
        />
      </Routes>
    </div>
  );
}
